import React, { useEffect, useState } from "react";
import apiRoutes from "../apiRoutes"; // Import API routes
import "../styles/dashboard.css";

interface Movie {
  id: number;
  title: string;
  poster: string;
  genre: string;
  duration: string;
  status: "Now Showing" | "Coming Soon";
}

const AdminDashboard: React.FC = () => {
  const [movies, setMovies] = useState<Movie[]>([]);
  const [filteredMovies, setFilteredMovies] = useState<Movie[]>([]);
  const [activeTab, setActiveTab] = useState<"nowShowing" | "comingSoon">(
    "nowShowing"
  );
  const [sortBy, setSortBy] = useState<string>("title");

  useEffect(() => {
    fetch(`${apiRoutes.movies.getAll}`)
      .then((res) => res.json())
      .then((data) => {
        setMovies(data);
        setFilteredMovies(
          data.filter((movie: Movie) =>
            activeTab === "nowShowing"
              ? movie.status === "Now Showing"
              : movie.status === "Coming Soon"
          )
        );
      })
      .catch((err) => console.error("Error fetching movies:", err));
  }, [activeTab]);

  useEffect(() => {
    const sortedMovies = [...filteredMovies].sort((a, b) =>
      a[sortBy as keyof Movie].toString().localeCompare(b[sortBy as keyof Movie].toString())
    );
    setFilteredMovies(sortedMovies);
  }, [sortBy]);

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <aside className="sidebar">
        <h2>YourCinema Admin</h2>
        <button>Manage Movie</button>
        <button>Manage Room</button>
        <button>Manage Showtime</button>
        <button className="logout-btn">Logout</button>
      </aside>

      {/* Main Content */}
      <main className="content">
        {/* Header */}
        <header className="header">
          <div className="search-container">
            <label>Search :</label>
            <input type="text" placeholder="Search movie here..." />
          </div>
          <div className="user-profile">
            <span className="profile-icon">C</span> Admin
          </div>
        </header>

        {/* Tabs and Filters */}
        <div className="tabs">
          <button
            className={activeTab === "nowShowing" ? "active" : ""}
            onClick={() => setActiveTab("nowShowing")}
          >
            Now Showing
          </button>
          <button
            className={activeTab === "comingSoon" ? "active" : ""}
            onClick={() => setActiveTab("comingSoon")}
          >
            Coming Soon
          </button>
          <div className="filter">
            Sort by: 
            <select onChange={(e) => setSortBy(e.target.value)}>
              <option value="title">Title</option>
              <option value="genre">Genre</option>
              <option value="duration">Duration</option>
            </select>
          </div>
        </div>

        {/* Movie List */}
        <div className="movie-list">
          {filteredMovies.map((movie) => (
            <div key={movie.id} className="movie-card">
              <img src={movie.poster} alt={movie.title} />
              <div className="movie-info">
                <h3>{movie.title}</h3>
                <p>{movie.genre}</p>
                <p>{movie.duration}</p>
              </div>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default AdminDashboard;
